// src/pages/Algorithm3.js
import React from 'react';
import CodeEditor from '../../components/CodeEditor';


const Algorithm3 = () => {
  const codeSnippet = `// Code specific for Algorithm 3
function expand() {
  // Implementation details for Algorithm 3
}`;

  return (
    <div style={{ padding: '1rem' }}>
      <h1>Algorithm 3</h1>
      
      <section>
        <h2>Overview</h2>
        <p>
        This project implements and evaluates the Clique Listing Algorithm based on arboricity, as proposed by Chiba and Nishizeki. The algorithm efficiently lists all maximal cliques in a graph with a worst-case time complexity of O(a(G) * m) per clique, where a(G) is the arboricity of the graph and m is the number of edges.
        </p>
      </section>
      
      <section>
        <h2>Implementation Details</h2>
        <ul>
          <li><strong>Graph Representation:</strong> Combines adjacency lists with auxiliary structures for quick lookup.</li>
          <li><strong>Optimized DFS:</strong> Introduces a caching mechanism to avoid redundant calculations.</li>
          <li><strong>Memory Optimization:</strong> Uses lazy evaluation and efficient storage to reduce memory overhead.</li>
        </ul>
        <h3>Code</h3>
        <CodeEditor code={codeSnippet} />
      </section>
      
      <section>
        <h2>Expectation</h2>
        <ul>
          <li>Showcase reduced memory usage compared to Algorithms 1 and 2.</li>
          <li>Validate expected performance gains in recursive calls.</li>
        </ul>
      </section>
      
      <section>
        <h2>Observation</h2>
        <p>
          Tests indicate that the caching mechanism and memory optimizations significantly lower the space complexity, especially on large graphs.
        </p>
      </section>
    </div>
  );
};

export default Algorithm3;
